import React from 'react';
import {connect} from "react-redux";
import {Route, withRouter} from "react-router-dom"
import {compose} from "redux";
import LaterSeenOrder from "./LaterSeenOrder";
import Profile from "../../../Profile/Profile";


class LaterOrderContainer extends React.Component {


    render() {

        let watch
        if (this.props.item.eat === undefined) {
            watch = <Profile/>
        } else if (this.props.item.eat) {
            watch = <LaterSeenOrder item={this.props.item[this.props.match.params.id]}/>

        }
        return (
            {watch}
        )
    }
}


let mapStateToprops = (state) => {

    return {
        item: state.laterSeenPage.item,
        fake: state.laterSeenPage.fake,


    }


}

export default compose(
    connect(mapStateToprops, {}),
    withRouter,
)(LaterOrderContainer)
